import React from "react";
import { useGlobalContext } from "../context/globalcontext";

function T_income(){
const {totalIncome}= useGlobalContext()
    return(
      <div style={mystyle}>
        <p>Total Income</p>
        <p>{totalIncome()}</p>
      </div>

    )
}


const mystyle={
 background : "#7DA0CA" ,
 color : "white" ,
 height : "120px",
 width :  "400px" ,
}

export default T_income
